// About.js
import React from "react";
import "./About.css";

const About = () => {
  return (
    <div className="about-section">
      <img
        src="https://www.shutterstock.com/image-vector/nice-meet-you-slogan-bear-260nw-1979769296.jpg"
        alt="About Us"
      />
      <h1>Why choose us?</h1>
      <p>
        Welcome to our House Essentials application! Find everything from
        furniture to home decor, all in one place.
      </p>
      <p>
        Our goal is to provide you with quality items at affordable prices.
        Explore now!
      </p>
    </div>
  );
};

export default About;
